import React from "react";

const Navbar = () =>{
    return(
        <>
           <header>
           
                <link to='/'>Contact Us</link>
                <link to='/contact'>Contact Us</link>
                <link to='/contact/name'>Contact Us</link>
            
           </header>

        </>
    )
}
export default Navbar;
